import { useState } from "react";
import DateTimePicker from 'react-datetime-picker';

function Todo(){
    const [dueTime, setDueTime] = useState(new DateTimePicker);
    return (
        <div>
            <DateTimePicker/>
            <p>3 {dueTime}</p>
        </div>
    );
}

export default Todo
